import { Link } from "react-router-dom";
import MenuIcon from "@mui/icons-material/Menu";

import LogoutIcon from "@mui/icons-material/Logout";
import logo from "../assets/coffe-cup.png";
function Navbar({ onNavLogout, ontoggle }) {
  return (
    <nav className=" text-white flex justify-between h-16 p-4 text-xl">
      <h1 className=" ml-4">Coffee O'clock</h1>
      <button
        onClick={() => {
          ontoggle();
        }}
      >
        {/* <MenuIcon/>  */}
      </button>
      <Link to="/">
        {" "}
        <img src={logo} alt="not found" />
      </Link>
      <div>
        <Link className="px-4" to="/home">
          Home
        </Link>
        <Link className="px-4" to="/about">
          About
        </Link>
        <Link className="px-4" to="/menu">
          Menu
        </Link>
        <Link className="px-4" to="/contact">
          Contact
        </Link>
        <Link className="px-4" to="/contact">
          cart comp
        </Link>
      </div>
    </nav>
  );
}

export default Navbar;
